import React from 'react';


function App() {
  const handleSubmit = (e) =>{
    e.preventDefault()
  }
  return (
    <div className="App">
      <header className="App-header">
        <form onSubmit = {handleSubmit}>
            <input id = "search" type = "text" placeholder = "your next song is..."/> Search
            <input type = "submit"></input>
        </form>
      </header>
    </div>
  );
}

export default App;
